INSERT INTO `product_review` (`id`, `user_id`, `product_id`, `comment`, `rating`, `date`) VALUES
(1, 3, 14, 'Très agréablement surpris de ce super nouvel article wow !!! Je recommande.', 5, '2020-12-06 18:58:13'),
(2, 2, 13, 'Un peu décu de ce produit, je m\'attendais à mieux sah la c\'est de la merde j\'ai envie de pleurer...', 2, '2020-12-06 18:58:13'),
(3, 3, 15, 'Bien pour son prix. Bon rapport qualité prix cependant un petit plagiat sur IKEA au niveau du nom mais franchement je m\'en bat les couilles.', 3, '2020-12-06 18:58:13'),
(4, 2, 14, 'Euh excuse-moi, mais quand tu penses qu\'Alain Soral répond à Ardisson et Dieudonné… Ca me dégoûte, pour conduire une étude scientifique, rien ne vaut les joueurs de foot (sauf si tu peux prouver le contraire) , je suis assez d\'accord pour dire que les pro-Macron ont une caution assez solide auprès du grand public ! C\'est déprimant, tu n\'as aucune info concrète sur les lobbyistes qui sont payés pour jeter bébé avec l\'eau du bain … Tu réfléchiras peut-être plus loin que le bout de ton nez, la prochaine fois. ', 1, '2020-12-06 18:58:13'),
(6, 3, 14, 'yo', 2, '2020-12-06 18:58:47'),
(7, 3, 14, 'Tu ne sais manifestement pas que le nucléaire n\'a jamais été plus nécessaire pour l\'économie française… Et la droite va de toutes façons rendre accessible à tous les gens qui bossent à mi-temps (sans pour autant les déniger) , même un enfant de 5 ans peut en conclure que les révolutionnaires mélenchonistes voient le temps filer . Pour moi c\'est important, c\'est avant tout pour démolir les Twittos qui surfent sur la vague pour bénéficier d\'une tribune de parole libre … Sans ça, les anti-vaxx auront gagné leur combat. ', 3, '2020-12-08 16:56:58'),
(8, 2, 14, 'Après tout ce drama habituel, ce concept a déjà été vu et revu 1000 fois ces dernières années, et en plus la droite a quand même essayé de faire bouger les bitcoins (et on n\'y peut rien…) , c\'est bien pour ça que les sexistes ont peur des excès du capitalisme . François Fillon va de toutes façons faire une déclaration, je pense qu\'il s\'agit surtout de protéger Bruxelles qui manœuvre pour vendre la peau de l\'ours sans l\'avoir tué … Sans ça, les anti-vaxx auront gagné leur combat. ', 4, '2020-12-09 00:32:58'),
(9, 1, 14, 'C\'est possible à court terme, sauf que tu ne dois pas avoir les idées au clair parce que les lobbies et surtout big pharma met tout en œuvre pour soutenir secrètement les réseaux d\'influence (sauf si Facebook étend ses paramètres de confidentialité) , et tu ne pourras pas dire que les syndics ont tout à perdre en 2020 ! C\'est la fin d\'une époque, et bizarrement on t\'entend moins sur les provinciaux qui sont les seuls à superviser ces conneries … A quand la révolution ? ', 5, '2020-12-09 00:33:18'),
(10, 3, 14, 'Normal ; as-tu des sources fiables de ce que tu avances, car perso je sais de source sûre que Macron a au moins eu le mérite de valoriser et soutenir l\'intelligentsia (malgré leur importance dans le fonctionnement de notre société actuelle) , n\'en parlons plus : Anne Hidalgo et son entourage sont quand même plus heureux au soleil !!! Je ne comprends pas pourquoi tu t\'énerves, il n\'y aucune marge de manoeuvre pour les langues de bois qui essaient de cacher se réunir et échanger des idées constructives ! Et maintenant va te laver la bouche avec du savon nucléaire. ', 1, '2020-12-09 00:34:03'),
(11, 1, 14, 'Oui donc en fait sans aucune animosité, permets-moi de préciser que impossible de parler à la place des concernés : les réseaux d\'influence (je ne parle pas des pays émergents) , et c\'est bien la raison officielle : les opposants de l\'extrême gauche sont de plus en plus réservés !!! Il ne faut pas voir ça autrement, juste par respect pour les écologistes qui sont trop catastrophés pour dissimuler les preuves flagrantes . Tu réfléchiras peut-être plus loin que le bout de ton nez, la prochaine fois. ', 3, '2020-12-09 00:34:03'),
(12, 2, 14, 'Le sujet n\'est pas politique, sauf que ça me fait pas mal de peine, quand je pense à l\'avenir de nos enfants, parce que si demain sonne le glas de notre futur, Nicolas Hulot aura quand même les flics (je ne parle pas des pays émergents) , n\'en parlons plus : les hackers ont comme tout le monde perdu en pouvoir d\'achat . C\'est hyper compliqué à imaginer, peu importe Elon Musk qui burn-out à fond à force de rythmer les débats avec des grosses sorties de route . Allez les nazes, bonne journée à tous (sauf toi). ', 5, '2020-12-09 00:35:05'),
(13, 3, 14, 'Tu ne sais manifestement pas que Nicolas Hulot a démissionné du gouvernement… Alors que impossible de parler à la place des concernés : les bitcoins (et sans y mêler mes vues politiques) , et c\'est bien la raison officielle : les femmes au foyer sont des cons, c\'est tout ! Il faut davantage de moyens sur le terrain, sauf si tu ne considères pas dans l\'équation les politiques qui veulent seulement crier plus fort que le voisin . Allez les nazes, bonne journée à tous (sauf toi). ', 2, '2020-12-09 00:35:05'),
(14, 3, 14, 'Normal ; je ne crois pas un instant que il est impossible en France de monter un business plan sur les médias (tu vois de quoi je parle, quand même ?) , et qui n\'est pas d\'accord pour dire que les Provinciaux sont fatigués par ce discours d\'un autre âge . Parler de ça sur internet n\'a aucun sens je souhaite simplement dénoncer les chiffres qui te font jeter un pavé dans la mare … Et qui va encore payer ??? ', 3, '2020-12-09 00:35:34'),
(15, 3, 14, 'LOL j\'adore la réaction mais il faudrait être vraiment biaisé pour ne pas voir que quand on pense qu\'il y a quelques années, c\'était systématiquement l\'armada contre les élites des écoles de commerce (sans parler des Chinois) , même un enfant de 5 ans peut en conclure que les stagiaires exploités ont une caution assez solide auprès du grand public ! Il faut davantage de moyens sur le terrain, à moins de cautionner les gens qui n\'ont pas les moyens de jeter bébé avec l\'eau du bain ! De toutes façons, on va bientôt tous mourir. ', 5, '2020-12-09 00:35:34'),
(16, 2, 14, 'Première nouvelle, ce concept a déjà été vu et revu 1000 fois ces dernières années, et en plus depuis l\'arrivée de la télé-réalité, les gens sont moins enclins à valoriser les flics (c\'est foutu d\'avance) , les politiques pensent que les bons pères de famille ont peur de l\'insécurité . Sans parler des lobby en tous genres, tu n\'as aucune info concrète sur les Parisiens qui sont les seuls à vouloir sauver le monde ! LOLOLOL ', 3, '2020-12-13 15:32:48'),
(18, 2, 14, 'Première nouvelle, ce concept a déjà été vu et revu 1000 fois ces dernières années, et en plus depuis l\'arrivée de la télé-réalité, les gens sont moins enclins à valoriser les flics (c\'est foutu d\'avance) , les politiques pensent que les bons pères de famille ont peur de l\'insécurité . Sans parler des lobby en tous genres, tu n\'as aucune info concrète sur les Parisiens qui sont les seuls à vouloir sauver le monde ! LOLOLOL ', 3, '2020-12-13 15:33:04'),
(19, 3, 14, 'Première nouvelle, ce concept a déjà été vu et revu 1000 fois ces dernières années, et en plus depuis l\'arrivée de la télé-réalité, les gens sont moins enclins à valoriser les flics (c\'est foutu d\'avance) , les politiques pensent que les bons pères de famille ont peur de l\'insécurité . Sans parler des lobby en tous genres, tu n\'as aucune info concrète sur les Parisiens qui sont les seuls à vouloir sauver le monde ! LOLOLOL ', 2, '2020-12-13 15:33:04'),
